import "babel-polyfill";
import UERequest from "./utils/UERequest.js";
import User from "./models/User.js";

export default class UnificationEngine {

    constructor( apiKey, apiSecret ) {
        this.apiKey = apiKey;
        this.apiSecret = apiSecret;
    }

    /**
     * Creates a UE User
     *
     * @return {Promise<User>} user the created user
     */
    createUser() {
        if ( !this.apiKey || !this.apiSecret ) {
            throw new Error("API_KEY and API_SECRET are required");
        }
        return new Promise(( resolve, reject ) => {
            UERequest({
                url    : "https://apiv2.unificationengine.com/v2/user/create",
                method : "POST",
                auth   : {
                    user : this.apiKey,
                    pass : this.apiSecret
                }
            })
            .then(userResponse  => {
                const  user = new User(userResponse.uri);
                resolve(user);
            })
            .catch(err  => reject(err));

        });
    }

    /**
     * Deletes a UE User
     *
     * @param {Promise<User>} user the user to delete
     * @return {Promise}
     */
    deleteUser( user ) {
        return UERequest({
            url    : "https://apiv2.unificationengine.com/v2/user/delete",
            method : "POST",
            auth   : {
                user : this.apiKey,
                pass : this.apiSecret
            },
            form   : {
                uri : user.uri
            }
        });
    }

    /**
     * Returns a list of users for the current app
     *
     * @return {Promise<User>} users array of users on the app
     */
    listUsers() {
        return new Promise(( resolve, reject ) => {
            UERequest({
                url    : "https://apiv2.unificationengine.com/v2/user/list",
                method : "POST",
                auth   : {
                    user : this.apiKey,
                    pass : this.apiSecret
                }
            })
            .then(users  => resolve(users))
            .catch(err  => reject(err));
        });
    }

}

import User from "./User.js"
import UERequest from "../utils/UERequest.js"
import logger from "../utils/logger.js"
export default class Connection {

    /**
     * Constructor
     * @param {String}  connectionName the connection identifier
     * @param {String} connectionUri the connection uri
     * @param {User} User the User instance of the user owning the connection
     *
     */
    constructor(connectionName, connectionUri, user) {
        if(!(user instanceof User))
            throw new Error("USer instance required when creating a connection");
        this.uri = connectionUri;
        this.name = connectionName;
        this.user = user;
    }



    //TODO: undefined
    connectionRefresh() {

    }

    /**
     * Used for message parts
     * @access private
     * @returns {Number} random id
     */
    _generateUniqueId(){
        function s4() {
            return Math.floor((1 + Math.random()) * 0x10000)
            .toString(16)
            .substring(1);
        }
        return s4() + s4() + '-' + s4() + '-' + s4() + '-' +
            s4() + '-' + s4() + s4() + s4();
    }

    /**
     * Builds the API message parameter from passed options
     *
     * @access private
     * @param {Object} messageOptions options for message
     * @param {Array} messageOptions.receivers channels receiving the message
     * @param {String} messageOptions.receivers.name channel name (Me | Page)
     * @param {String} messageOptions.receivers.id in case of Page, this is the page id
     * @param {String} messageOptions.message.subject message subject
     * @param {Array} messageOptions.message.body message body
     * @param {Array} messageOptions.message.image image uri
     * @param {Array} messageOptions.message.link message link
     * @param {Array} messageOptions.message.link.uri message link uri
     * @param {Array} messageOptions.message.link.description  message link description
     * @param {Array} messageOptions.message.link.title  message link title
     *
     * @returns {Promise}
     */
    _buildMessageQuery(messageOptions) {
        if(!messageOptions.receivers || !messageOptions.message)
            throw new Error("Message must have a message and areceiver")

        const defaultContentType = "binary";
        let params = Object.assign({},messageOptions) //Clone for immutability
        let queryObject = {}
        //Formulate Receivers
        params.receivers = params.receivers.map((receiver)=>{
            if(receiver.name && receiver.name.toLowerCase() === "me"){
                return {
                    "name":"Me",
                    "address":"test.test",
                    "Connector": this.name
                }
            }
            else {

                if(receiver.name && receiver.name.toLowerCase() === "page"){
                    return {
                        "name":"Page",
                        "address": receiver.id,
                        "Connector": this.name
                    }
                }
            }
        });
        queryObject.receivers = params.receivers;


        //Formulate Message Parts
        queryObject.parts = [];
        if(params.message.body){
            queryObject.parts.push({
                id: this._generateUniqueId(),
                contentType: defaultContentType,
                type: "body",
                data: params.message.body,
            })
        };

        //Image Part
        if(params.message.image){
            queryObject.parts.push({
                id: this._generateUniqueId(),
                contentType: defaultContentType,
                type: "image_link",
                data: params.message.image
            })
        };


        //Link Part
        if(params.message.link) {
            if(params.message.link.uri){
                queryObject.parts.push({
                    id: this._generateUniqueId(),
                    contentType: defaultContentType,
                    type: "link",
                    data: params.message.link.uri
                });
            }

            if(params.message.link.description){
                queryObject.parts.push({
                    id: this._generateUniqueId(),
                    contentType: defaultContentType,
                    type: "link_description",
                    data: params.message.link.description
                })
            }

            if(params.message.link.title){
                queryObject.parts.push({
                    id: this._generateUniqueId(),
                    contentType: defaultContentType,
                    type: "link_title",
                    data: params.message.link.title
                })
            }

        }

        //Subject
        if(params.message.subject) {
            queryObject.subject = params.message.subject;
        }


        logger.info(queryObject);
        return queryObject;


    }


    /**
     * Sends a message to service using a connector. A message can have multiple parts each with a different type.
     * eg: One can send a message with 2 parts (image_link, body) to send a message with an image and text
     *
     * @param {Object} messageOptions options for message
     * @param {Array} messageOptions.receivers channels receiving the message
     * @param {String} messageOptions.receivers.name channel name (Me | Page)
     * @param {String} messageOptions.receivers.id in case of Page, this is the page id
     * @param {String} messageOptions.message.subject message subject
     * @param {Array} messageOptions.message.body message body
     * @param {Array} messageOptions.message.image image uri
     * @param {Array} messageOptions.message.link message link
     * @param {Array} messageOptions.message.link.uri message link uri
     * @param {Array} messageOptions.message.link.description  message link description
     * @param {Array} messageOptions.message.link.title  message link title
     *
     * @returns {Promise}
     */
    //TODO: Simplify params
    sendMessage(messageOptions) {
        //Mutate receiver connector to current instance
        messageOptions.receivers = messageOptions.receivers.map((rec)=> {
            rec.Connector = this.name;
            return rec
        });
        return UERequest({
            url    : "https://apiv2.unificationengine.com/v2/message/send",
            method : "POST",
            auth   : {
                user : this.user.userKey,
                pass : this.user.userSecret
            },
            form: {
                message: this._buildMessageQuery(messageOptions)
            }
        });
    }
}

import UERequest from "../utils/UERequest.js";
import Connection from "./Connection.js";
import supportedConnectionSchemes from "../config/service_schemes.js";
import logger from "../utils/logger.js";

export default class User {

    //URI: user://e9759590-54ef-4cd3-a01c-cb2241ddd812:1aee1a25-e0c4-4036-a8fd-4d41adc8611b@
    //COMB: key,secret
    /**
     * Constructor
     * @desc The constructor can be in one of two forms; URI form or key,secret form. eg new User(key,secret) or new User(uri)
     * @param {String} uri the user uri string
     * @param {String} key the user key
     * @param {String} secret the user secret
     */
    constructor(uri){
        let key,secret;
        //Check if arguments is user uri or key,secret combination
        if(arguments[1]){
            [key,secret] = [arguments[0],arguments[1]];
            this.uri = `user://${key}:{secret}@`;
        }
        else {
            //Extract user tokens from returned uri
            const keySecretPattern = /user:\/\/(.+):(.+)@/;

            //Destructing assignment for userKey, userSecret
            [key, secret] = [uri.match(keySecretPattern)[1], uri.match(keySecretPattern)[2]];
            this.uri = arguments[0];
        }

        this.userKey = key;
        this.userSecret = secret;
        if(!this.userKey || !this.userSecret){
            throw new Error("USER_KEY and USER_SECRET are required.");
        }
    }

    /**
     * Adds a connection to the current user
     *
     * @param {String} connectionName the connection identifier. Unique per connection
     * @param {String} service a string representing a connector service - supported services are in config/service_schemes.js
     * @param {String} serviceAccessToken service access token acquired from the provider (fb token, twitter token..etc)
     *
     * @return {Promise<Connection>} connection the created connection
     */
    addConnection(connectionName, service, serviceAccessToken) {
        if(!supportedConnectionSchemes.includes(service)){
            throw new Error(`Unrecognized service connection scheme: ${service} `)
        }

        const connectionUri  = `${service}://${serviceAccessToken}@${service}.com`;
        return new Promise((resolve,reject) => {
            UERequest({
                url: "https://apiv2.unificationengine.com/v2/connection/add",
                method: "POST",
                auth: {
                    user: this.userKey,
                    pass: this.userSecret
                },
                form:{
                    uri: connectionUri ,
                    name: connectionName
                }
            })
            .then(connection => {
                const ueConnection = new Connection(connectionName, connectionUri, this );
                resolve(ueConnection);
            })
            .catch(err => reject(err));
        });
    }

    /**
     * List connections for current user
     * @return {Promise<Connection>} List of Connection objects representing the user connections
     */
    listConnections() {
        if ( !this.userKey || !this.userSecret ) {
            throw new Error("User not authenticated");
        }
        return new Promise(( resolve, reject ) => {
            UERequest({
                url    : "https://apiv2.unificationengine.com/v2/connection/list",
                method : "POST",
                auth   : {
                    user : this.userKey,
                    pass : this.userSecret
                }
            })
            .then(response  => {
                // Parse response and create Connection objects
                const connectionsResponse = response.connections;
                const connections = (() => {
                    let connectionObjects = [];
                    for(var key of Object.keys(connectionsResponse)){
                        const connection = new Connection( key,connectionsResponse[key].uri, this)
                        connectionObjects.push(connection);
                    }
                    return connectionObjects;
                })();
                resolve(connections);
            })
            .catch(err  => reject(err));

        });

    }



    /**
     * Removes a connection from a user
     *
     * @param {String} connectionName the connection identifier
     * @return {Promise}
     */
    removeConnection(connectionName) {
        return UERequest({
            url    : "https://apiv2.unificationengine.com/v2/connection/remove",
            method : "POST",
            auth   : {
                user : this.userKey,
                pass : this.userSecret
            },
            form: {
                name: connectionName
            }
        });
    }


    /**
     * Tests a connection to a connector
     *
     * @param {String} serviceUri service uri. eg: facebook://accesstoken@facebook.com
     * @return {Promise}
     */
    testConnection(serviceUri) {
        return UERequest({
            url    : "https://apiv2.unificationengine.com/v2/connection/test",
            method : "POST",
            auth   : {
                user : this.userKey,
                pass : this.userSecret
            },
            form: {
                uri: serviceUri
            }
        });

    }



}

import request from "request";
import errors from "../config/errors.js"
import logger from "./logger.js";

/**
 * HTTP Request Middleware
 * @param _requestOptions Object with request options for a list of all options  check https://www.npmjs.com/package/request
 * @returns {Promise} promise  a promise that resolves to the request body
 */
module.exports = function ( _requestOptions ) {

    // UE Requires empty json object if no params to be passed
    _requestOptions.form = _requestOptions.form || "{}";

    // set POST to default method
    _requestOptions.method = _requestOptions.method || "POST";

    //Stringify form
    if ( typeof _requestOptions.form === "object" ) {
        _requestOptions.form = JSON.stringify(_requestOptions.form);
    }

    logger.debug(`http => ${_requestOptions.url} `,_requestOptions);

    return new Promise(( resolve, reject ) => {
        request(_requestOptions, ( err, res, body ) => {
            logger.debug(`resp => ${body.trim()}`)

            if (!err && res.statusCode == 200) {
                console.log(body) // Show the HTML for the Google homepage.
                try {
                    body = JSON.parse(res.body);
                    resolve(body);
                }
                catch ( parseException ) {
                    reject(err, parseException);
                }
            }
            else {
                if(errors[res.statusCode]){
                    reject(errors[res.statusCode]);
                    logger.error(errors[res.statusCode])
                }
                else {
                    reject({
                        status: res.statusCode,
                        info: body
                    });
                    logger.error(body);
                }
            }
        });

    });

};

